import ExpenseItem from './ExpenseItem'
function Expenses(props) {
    return (
        <div>
            <h1>Let's get started!</h1>
            {props.items.map(item => (
                
                <ExpenseItem 
                    key={item.id}
                    title={item.title}
                    amount={item.amount}
                    date={item.date}
                />
            ))}
        </div>
    )
}

export default Expenses;
